import React from "react";
//import './styles/content.css';


function Content() {
  let cars=["audi","bmw","volvo","mersedes","citroen","renault","dodge","ford","kia","hyiundai","acura","infiniti","nissan","Toyota","Suzuki","Jeep","Cadillac","Lexus"]
  return (
  <div className="cont">
   <div className="side_bar">
    {cars.map((item,index)=><p className="cars" key={index}>{item}<hr></hr></p>)}
    </div>
    <div className="main_content"></div>
   </div>
  );
}

export default Content;
